import React from "react";
import { Navbar, Button } from "flowbite-react";
import { Link } from "react-router-dom";

const Navigation = () => {
    return (
        <div>
            <Navbar className="container mx-auto py-6" fluid={true} rounded={true}>
                <Navbar.Brand href="https://flowbite.com/">
                    <img src="https://flowbite.com/docs/images/logo.svg" className="mr-3 h-6 sm:h-9" alt="Flowbite Logo" />
                    <span className="self-center whitespace-nowrap text-xl font-semibold dark:text-white">Flowbite</span>
                </Navbar.Brand>
                <div className="flex md:order-2">
                    {/* <Button>Get started</Button> */}
                    <button className="bg-primary hover:bg-white text-quaternary hover:text-primary py-2 px-4 text-sm font-semibold rounded-md border-2 border-primary ease-in-out transition duration-700">Login</button>
                    <Navbar.Toggle />
                </div>
                <Navbar.Collapse className="font-semibold">
                    {/* <Navbar.Link href="/" className="font-semibold hover:text-primary active:text-primary" active={true}>
                        Home
                    </Navbar.Link>
                    <Navbar.Link href="/job-vacancy" className="font-semibold hover:text-primary active:text-primary">
                        Job Vacancy
                    </Navbar.Link> */}
                    <li>
                        <Link
                            to="/"
                            className="block py-2 pl-3 pr-4 text-gray-700 rounded hover:bg-gray-100 md:hover:bg-transparent md:hover:text-blue-700 md:p-0 md:dark:hover:text-white dark:text-gray-400 dark:hover:bg-gray-700 dark:hover:text-white md:dark:hover:bg-transparent dark:border-gray-700"
                        >
                            Home
                        </Link>
                    </li>
                </Navbar.Collapse>
            </Navbar>
        </div>
    );
};

export default Navigation;
